# Natural Language Toolkitimport nltk# Import data file to carry on Data Analystimport DataAnalysis as da# use of a Data Set from UCI --> SMS Spam Collection Data Set# Data set with messages label as Spam of Ham (good ones)def DataPreprocessor(file_name):    #open the file of the Messages    f = open(file_name)    # we get the messages into a list variable,we split the text by the endsapce of each message    messages = [line.rstrip() for line in f] # spaces at the end of the string are removed    return messagesdef main():    messages = DataPreprocessor('SMSSpamCollection')    da.PrintNMessages(messages, 24)if __name__ == "__main__":    main()